import React from 'react';
import { BrowserRouter as Router, Route, Routes} from 'react-router-dom';
import LoginPage from './pages/LoginPage';
import MainPage from './pages/MainPage';
import SignUpPage from './pages/SignUpPage';
import Tehran from './pages/Tehran';
import Kish from './pages/Kish';
import Ramsar from './pages/Ramsar';
import Qeshm from './pages/Qeshm';

function App() {
  return (
    <>
      <Router>
        <Routes>
          <Route exact path="/" element={<MainPage />}></Route>
          <Route path="/tehran" element={<Tehran />}></Route>
          <Route path="/kish" element={<Kish />}></Route>
          <Route path="/ramsar" element={<Ramsar />}></Route>
          <Route path="/qeshm" element={<Qeshm />}></Route>
          <Route path="/login" element={<LoginPage />}></Route>
          <Route path="/signup" element={<SignUpPage />}></Route>
        </Routes>
      </Router>
    </>
  );
}

export default App;
